using RTC.Interface; 
using RTC.Base; 
using System; 
using System.Collections.Generic; 
using System.Linq; 
using RTC.Core.Extension; 
using RTC.Converter; 

namespace RTC.Core 
{ 
    public sealed class RTConsole 
    { 
        #region Events 

        public event EventHandler<CommandEvent> CommandExecuted; 
        public event EventHandler<CommandReceivedEvent> CommandReceived; 
        public event EventHandler<ExceptionEvent> Exception; 

        private void OnCommandExecuted(CommandEvent e) 
        { 
            CommandExecuted?.Invoke(this, e); 
        } 

        private void OnCommandRecieved(CommandReceivedEvent e) 
        { 
            CommandReceived?.Invoke(this, e); 
        } 

        private void OnException(ExceptionEvent e) 
        { 
            Exception?.Invoke(this, e); 
        } 

        #endregion 

        #region Initialization 
        private static RTConsole instance; 
        private RTConsole() { } 

        public static RTConsole Instance 
        { 
            get 
            { 
                if (instance == null) 
                { 
                    instance = new RTConsole(); 
                    instance.Initialize(); 
                } 

                return instance; 
            } 
        } 

        private void Initialize() 
        { 
            EnableBuiltInCommands = true; 
            EnableInternalLogs = true; 

            Logger = new Logger(100); 
            CommandsProvider = new CommandsProvider(); 
            SyntaxAnalyzer = new Analyzer(); 
            Parser = new Parser(); 
            Types = new TypesProvider(); 
            TypeConverters = new TypeConverterProvider(); 
            ExceptionFormatter = new ExceptionFormatter(); 
        } 
        #endregion 

        #region Properties 
        public ITypesProvider Types 
        { 
            set 
            { 
                AddCommandsInternal(value.GetTypes()); 
            } 
        } 

        public ITypeConverterProvider TypeConverters 
        { 
            get 
            { 
                return typeConverter; 
            } 
            set 
            { 
                typeConverter = value; 
                typeConverter.Add(new PlainTextConverter()); 
            } 
        } 

        public IEnumerable<CommandInfo> Commands 
        { 
            get 
            { 
                return commandsDictionary.Select(kvp => kvp.Value); 
            } 
        } 

        public bool EnableBuiltInCommands { get; set; } 
        public bool EnableInternalLogs { get; set; } 
        public bool HandleExceptions { get; set; } 
        public AbstractAnalyzer SyntaxAnalyzer { get; set; } 
        public AbstractParser Parser { get; set; } 
        public AbstractLogger Logger { get; set; } 
        public IFormatter<Exception> ExceptionFormatter { get; set; } 
        #endregion 

        #region Variables 
        private Dictionary<string, CommandInfo> commandsDictionary; 
        private ITypeConverterProvider typeConverter; 
        private CommandsProvider CommandsProvider; 
        #endregion 

        #region Methods 
        public CommandInfo GetCommand(string command) 
        { 
            CommandInfo value; 
            commandsDictionary.TryGetValue(command, out value); 
            return value; 
        } 

        private void AddCommandsInternal(Type[] types) 
        { 
            if (EnableBuiltInCommands) 
            { 
                commandsDictionary = CommandsProvider.GetCommands(new BuiltInTypesProvider().GetTypes()); 
                var commands = CommandsProvider.GetCommands(types); 

                foreach (var kvp in commands) 
                { 
                    if (commandsDictionary.ContainsKey(kvp.Key)) 
                    { 
                        Instance.LogFormatInternal(LogTypes.Warning, kvp.Key, "Ignored {0} because it's a built-in command name.", kvp.Key); 
                        continue; 
                    } 

                    commandsDictionary.Add(kvp.Key, kvp.Value); 
                } 
            } 
            else 
            { 
                commandsDictionary = CommandsProvider.GetCommands(types); 
            } 
        } 

        public void Execute(string command) 
        { 
            if (command.IsNullOrWhiteSpace()) return; 

            OnCommandRecieved(new CommandReceivedEvent(command)); 

            var result = SyntaxAnalyzer.Analyze(command); 

            if (!result.IsValid) 
            { 
                Instance.LogInternal(LogTypes.Error, command, string.Join(Environment.NewLine, result.Errors)); 
                return; 
            } 

            CommandInfo cmdInfo; 
            if (!commandsDictionary.TryGetValue(result.CommandName, out cmdInfo)) 
            { 
                Instance.LogFormatInternal(LogTypes.Error, command, "{0} is not a valid command.", result.CommandName); 
                return; 
            } 

            var methodParams = cmdInfo.Method.GetParameters(); 
            var parserResult = Parser.Parse(result, TypeConverters, methodParams); 

            if (!parserResult.Success) 
            { 
                string error = string.Join(Environment.NewLine, parserResult.Errors); 
                Instance.LogInternal(LogTypes.Error, command, error); 
                return; 
            } 

            int minParamsCount = methodParams.Count(p => p.IsOptional); 

            if (parserResult.Result?.Length < minParamsCount) 
            { 
                Instance.LogFormatInternal(LogTypes.Error, command, "Minimum parameters required: {0}{1}Got: {2}", minParamsCount, Environment.NewLine, parserResult.Result?.Length); 
                return; 
            } 

            if (HandleExceptions) 
            { 
                try 
                { 
                    OnCommandExecuted(new CommandEvent(cmdInfo)); 
                    cmdInfo.Method.Invoke(null, parserResult.Result); 
                } 
                catch (Exception ex) 
                { 
                    var error = string.Format("Reflected Type -> {0}{1}{2}", cmdInfo.Method.ReflectedType, Environment.NewLine, ExceptionFormatter.Format(ex)); 

                    Instance.LogInternal(LogTypes.Exception, command, error); 
                    OnException(new ExceptionEvent(ex)); 
                } 
            } 
            else 
            { 
                OnCommandExecuted(new CommandEvent(cmdInfo)); 
                cmdInfo.Method.Invoke(null, parserResult.Result); 
            } 
        } 
        #endregion 
    } 
}
